import React from 'react'

import TodoList from './hooks/TodoList'
import productsData from './data/products.json'

console.log(productsData)
const todos = [
    {
        text: 'Eat lunch',
        completed: true,
        id: 1
    },
    {
        text: 'Research Redux',
        completed: true,
        id: 2
    },
    {
        text: 'Finish app',
        completed: false,
        id: 3
    }
]

function App() {
    return (
        <div>
        <h1>Penny Candy Store</h1>
        <TodoList todos={todos} />
        </div>
    )
}

export default App;
